import React from 'react';
import Style from './fala.module.css'

const Fala = () => {
  const containerStyle = {
    display: 'flex',
    justifyContent: 'space-between',
    width: '300px',
    height: '100px',
    
  };

  const roundedBorderStyle = {
    flex: '1',
    background: '#3498db',
    borderRadius: '30px 30px 30px 0',
    padding: '20px',
    color: 'white',
  };

  return (
    <div className={Style.containerStyle}>
      <div className={Style.roundedBorderStyle}>
        This has rounded borders on top.
      </div>
    </div>
  );
};

export default Fala;
